import React from 'react';
import { Link } from 'react-router-dom';

import { PieChart, PieArcSeries } from 'reaviz'; // to download library, in terminal enter: "npm i reaviz"

const dataEI = [
  { key: 'Introverted', data: 55 },
  { key: 'Extraverted', data: 45 }
];

const dataSN = [
  { key: 'Observant', data: 60 },
  { key: 'Intuitive', data: 40 }
];

const dataTF = [
  { key: 'Thinking', data: 70 },
  { key: 'Feeling', data: 30 }
];

const dataJP = [
  { key: 'Judging', data: 65 },
  { key: 'Prospecting', data: 35 }
];

const CompatabilityCharts = () => (
    <div className="chart-container" id="home">
      <div className="chart-top">
        <div className="chart-wrap" id="home">
          <PieChart
            width={300}
            height={200}
            data={dataEI}
            series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
          />
        </div>
        <div className="chart-wrap" id="home">
          <PieChart
            width={300}
            height={200}
            data={dataSN}
            series={<PieArcSeries colorScheme={['#BEB8EB', '#022B3A']} />}
          />
        </div>
      </div>
      <div className="chart-bottom">
        <div className="chart-wrap" id="home">
          <PieChart
            width={300}
            height={200}
            data={dataTF}
            series={<PieArcSeries colorScheme={['#E3EEE2', '#ACD1E9']} />}
          />
        </div>
        <div className="chart-wrap" id="home">
          <PieChart
            width={300}
            height={200}
            data={dataJP}
            series={<PieArcSeries colorScheme={['#F49A9A91', '#E0E0E2']} />}
          />
        </div>
      </div>
    </div>
  );


function Dashboard() {
    return (
        <main className="home">
            <div className="rectdashboard">
                <h3>Recent Activity</h3>
                <h4>Teams:</h4>
                <div className="classlinks">
                    <Link to="/teams"><div className="rectclass">
                        <p>The Daily</p>
                    </div></Link>
                    <Link to="/teams"><div className="rectclass">
                        <p>Team 6</p>
                    </div></Link>
                </div>
                <h4>Your MBTI Assessment:</h4>
                <div className="comphome">
                    <CompatabilityCharts />
                    <div className="left2">
                    </div>
                    <div className="right2">
                    </div>
                </div>
                <Link to="/compatability"><button className="complink">Go To Full Report</button></Link>
            </div>
        </main>
    );
}

export { Dashboard };
